----id,nome,sobrenome,login,supervisor,equipe
CREATE TABLE colaboradores (
	ID INT IDENTITY PRIMARY KEY,
	Nome VARCHAR(50) NOT NULL,
	Sobrenome VARCHAR(50) NOT NULL,
	"Login" VARCHAR(50),
	Supervisor CHAR(1),
	Equipe VARCHAR(50)
)


CREATE TABLE ponto (
	id_colaborador INT NOT NULL,
	data_ponto DATE,
	horario_entrada TIME,
	horario_saida TIME,
	saida_antecipada CHAR(1),
	justificativa VARCHAR(80)
)

ALTER TABLE PONTO
ADD CONSTRAINT FK_colaborador_ponto FOREIGN KEY (id_colaborador) references colaboradores(id)


--id,produtividade,c-sat chat, c-sat_e-mail,aderência, absenteísmo, qualidade.
CREATE TABLE indicadores (
	id_colaborador INT NOT NULL,
	produtividade decimal(6,2),
	csat_chat decimal(5,2),
	csat_email decimal(5,2),
	aderencia decimal(5,2),
	absenteismo decimal(5,2),
	qualidade decimal(5,2)
)
-- adicionando constraint foreing key.
ALTER TABLE indicadores
ADD CONSTRAINT FK_colaborador_indicadores FOREIGN KEY (id_colaborador) references colaboradores(id)

-- inserindo dados




UPDATE indicadores
SET data_indicador = '2022-01-04'
WHERE data_indicador = '2022-04-01'
-- inseri a data errada, por isso fiz este update.

SELECT data_indicador,horario_entrada,horario_saida, CASE
					WHEN p.horario_entrada > CONVERT(time,'08:00:00') AND p.horario_saida < CONVERT(time,'16:10:00')
						THEN DATEDIFF(minute,CONVERT(time,'08:00:00'),p.horario_entrada) + DATEDIFF(minute,p.horario_saida,CONVERT(time,'16:10:00'))
					WHEN p.horario_entrada > CONVERT(time,'08:00:00') 
						THEN  DATEDIFF(minute,CONVERT(time,'08:00:00'),p.horario_entrada)
					WHEN p.horario_saida < CONVERT(time,'16:10:00') 
						THEN DATEDIFF(minute,p.horario_saida,CONVERT(time,'16:10:00'))
					ELSE null
				END FROM indicadores as I
INNER JOIN ponto as P ON P.id_colaborador = I.id_colaborador
WHERE I.id_colaborador <= 16
-- esta fórmula é responsável por calcular o absenteismo. é apenas um cálculo, o dado não está na tabela.

