SELECT Nome,equipe,AVG(aderencia), ROW NUMBER() OVER(ORDER BY AVG(aderencia)) FROM indicadores as I
INNER JOIN colaboradores as C ON C.ID = I.id_colaborador
WHERE Equipe like 'Manhã' and Supervisor = 0
GROUP BY nome,equipe
ORDER BY AVG(aderencia)
